etty low. However, Rancho embarrassed a condescending Chatur publicly by rewriting a speech the latter had to deliver at a college function, igniting the challenge to see who would be more successful. After Raju's ailing father developed a [[stroke]], Rancho, with the help of Virus’ younger daughter Pia Sahastrabuddhe, a medical student, who was initially resentful of Rancho for insulting her father, took him to the hospital via her scooter. Following a reconciliation between Rancho and Raju, the trio attended the semester examinations, whereupon Farhan and Raju ended up among the bottom rankers whereas Rancho topped the class, owing to his natural inclination for engineering.Back to the present, Farhan, Raju and Chatur arrive at Shimla where they are shocked to meet another man who identifies himself as the actual Ranchoddas Shyamaldas Chanchad. Farhan and Raju ask Chatur about how he found the address in Shimla and Chatur replies he tracked Rancho to Shimla, when his secretary went there to meet international revolutionary scientist Phunsukh Wangdu, whom Chatur and his company have been trying to sign a deal with. They confront the man, who reveals that he indeed is Ranchod and the one they met in college is actually Chhote, the son of the actual Ranchod’s gardener. After discovering Chhote’s inclination for learning and studying at a young age, Ranchod’s father Shamaldas insisted Chhote to continue his education posing as Ranchoddas and get him a degree, after which he will cut off contact with all alma maters that he will be a part of. Ranchoddas reveals to Farhan and Raju that Chhote is in [[Ladakh]], and the duo travel there with Chatur.Back in the past, during their final year, Rancho and Pia fell in love and began a relationship and encouraged Farhan to confront his father about his passion and for Raju to be less worried and frightful of the future. After Farhan and Raju drunkenly broke into Virus’s house while Rancho sneaked in to propose to Pia, Virus threatened to rusticate Raju or have Rancho rusticated instead, prompting a distraught Raju to attempt suicide and end up in a coma. The group successfully recovered him over the next two months, after which he attended his placement interview with a new found confidence and secured a job while Farhan also successfully confronted his father and got a job with his role model photographer in [[Hungary]]. Unable to take the insult any longer, Virus rigged the paper in order for Raju to fail it, but Pia helped Rancho and Farhan break into Virus’s office to steal the question paper. Despite Raju refusing to use the paper, Virus discovered what happened and had the three rusticated in the middle of the night. As the trio were leaving the institute in the middle of heavy rainstorms, Pia’s sister Mona went into labor and Rancho, unable to get her to the hospital and with the help of Pia on a webcam and other students, successfully conducted the delivery with a makeshift [[Vacuum extraction|ventouse]]. Realizing the fault in his ways and how genius Rancho is, Virus let them stay for their exams and gifted Rancho a very rare [[Space Pen]]. Rancho topped the university in their final year, but abruptly left the graduation ceremony without informing anyone and was never heard of again.Back to the present, Farhan, Chatur and Raju pick Pia up from her wedding ceremony and travel to a school in Ladakh supposedly run by Rancho, where they are finally reunited with Rancho just as Chatur condescendingly insults Rancho’s apparent status as a schoolmaster and has him sign a “Declaration of Defeat”, and walks away in supposed victory. When Pia asks Rancho his real name, he reveals himself to be Phunsukh Wangdu and promptly calls off the deal with Chatur, to his shock. Phunsukh, Pia, Farhan and Raju run away laughing while a humiliated Chatur chases after them.",
